import TrueTextField from '@mui/material/TextField';
const TextField = () => {
    return (
        <div>
            <TrueTextField id="outlined-basic" label="Outlined" variant="outlined" />
            <Button variant="contained">Submit</Button>
        </div>
    )
}

export default TextField;
